    return(
       <nav>
            <div></div>
            <img src={Imagen} className="imagen"/>
            <ul>
                <NavLink to='/' className='space'>Inicio</NavLink>
            </ul>
            <Link to='/cart'>
        <CartWidget/>
        </Link>
        </nav>
    )
}
export default NavBar;
